INSERT INTO `achievement` (`achievement_id`, `number`, `description`, `type_id`) VALUES
                                                                                     (1, 1, 'Ścieżka bohatera: ukończ serię zadań startowych (status serii questów „Początek drogi bohatera” na etapie „Pomóż włodarzom Margonem”.', 1),
